import { useSelector } from 'react-redux'

function videolist() {
  var counter = ''
  useSelector(state =>
    state && state.posts != undefined
      ? (counter = state.posts)
      : state && (error = state.error)
  )
  return counter ? (
    <div className="videolist">
      {/* */}
      <div>
        <div className="videolistCartes">
          <div className="videolistInformation">
